# Download all of the source trees for version 2 of the synthetic tree.
# Includes git SHA, so exact tree versions should be returned.

# To regenerate this script, do:
# curl -X POST http://api.opentreeoflife.org/v2/tree_of_life/about -H "content-type:application/json"  -d '{"study_list":true}' > Draft2_sources.txt
# Then, replace:
# ^\W*"study_id" : "(.*)",\r\W*"git_sha" : "(.*)",\r\W*"tree_id" : "(.*)"
# with:
# curl http://api.opentreeoflife.org/v2/study/\1/tree/tree\3?starting_commit_SHA=\2 > \1_\3.nexson
# and then delete the few lines that did not match the pattern.

